import "./App.css";
import { Switch, Route } from "react-router-dom";
import { Home } from "./components/Home";

function App() {
  return (
    <div className="App">
      <h1>El mejor nro 1 </h1>

      <Route exact path="/Home" component={Home} />
    </div>
  );
}

export default App;
